Удобный интерфейс приложения поможет легко оформить заказ и получить нужную информацию пользователям всех возрастов и в любых ситуациях.

Избавьтесь навсегда от траты времени на объяснения, откуда Вас забрать и куда доставить. Просто используйте один из подходящих сейчас вариантов:
- выбор адреса из встроенного каталога;
- поиск адреса по Google Maps и Яндекс.Картам;
- заказ на точку на карте.

Оперативно получайте важную информацию по своему заказу на экране смартфона:
- расстояние от адреса подачи до места назначения по транспортной сети; 
- предварительная стоимость заказа;
- текущий статус заказа;
- данные по назначенному автомобилю;
- итоговый чек поездки.

При необходимости используйте возможность связи с водителем прямо из приложения. 

Мы дорожим Вашим выбором и стремимся повысить Ваш комфорт при пользовании услугами нашего такси. Попробуйте мобильное приложение для вызова такси и убедитесь, что каждое наше взаимодействие станет для Вас еще удобнее и приятнее.

INFOBUS is an application to search and purchase bus, train and plane tickets.

You can use INFOBUS for the following:
- book and buy tickets in just a few clicks without leaving home;
- check flight schedules online;
- always have tickets with you;
- automatically receive bonuses upon payment of a ticket.

Key Features:

Convenience - user-friendly interface;
Time saving – the application saves your time, so you could spend it on yourself :)
Efficiency – the ticket is immediately sent to your email upon payment;
Simplicity – easy-to-use search, booking and payment system;
Information content - the application contains up-to-date information on seats availability on flights, luggage transportation features, current prices and discounts, etc.;
Systematic updates – the application is constantly updated and supplemented with new information and features for the convenience of our customers.


We created this application to make your life easier.

INFOBUS
Choose the best

GAL trans is a Moldovan carrier company that operates regular bus services from Moldova to Romania, Ukraine and Russia.

With the application from GAL Trans you can easily:
– choose a flight suitable for the requested date;
– check buses routes on the map;
– see buses’ photos;
– make a reservation with payment to the driver during the boarding;
– pay for the ticket online;
– get access to the history of all purchased tickets in the personal account
– make a quick ticket return in your personal account
– request information from support service.

GAL Trans has a large bus fleet that meets European standards.

The professional drivers team will make sure that your trip is as comfortable as possible.

GAL Trans - it's important, who you travel with!

Uklon: More than a taxi


Uklon SuperApp is a Ukrainian service for online car ordering. It’s your multitool for convenient movement around the city and the country.


Download the Uklon app to do such things:
- Order a driver for a personal car;
- Send packages up to 20 kg without additional charge through the "Delivery" service;
- Go to another city of Ukraine;
- Quickly and conveniently order a car around the city;
- Manage the price of your trip;
- Pay by cash and non-cash payment method;
- Order a car for a trip with a pet;
- Choose additional services: non-smoking driver, English-speaking driver, meeting with a sign, etc.;
- Pre-order a car for a certain time;
- Have a fixed cost of trips;
- But the most important thing is that our technical support works 24/7 to help you at any moment.


The service already works in 28 cities of Ukraine: Kyiv, Kharkiv, Zaporizhzhia, Vinnytsia, Ivano-Frankivsk, Poltava, Odesa, Dnipro, Lviv, Mykolaiv, Mariupol, Kherson, Kryvyi Rih, Bila Tserkva, Chernivtsi, Khmelnytskyi, Lutsk, Rivne, Ternopil, Uzhhorod, Kremenchuk, Kamianske, Kropyvnytskyi, Cherkasy, Chernihiv, Sumy, Zhytomyr, Kamianets-Podilskyi.
*** Unfortunately, the service is temporarily unavailable in Mariupol and Kherson. Mariupol and Kherson are Ukrainian cities!


Move your world with Uklon!


If you have any suggestions, requests or find any mistakes, please contact us: ios@uklon.com.ua

The new Cris Taxi Bucuresti app offers:
- order a taxi with just two taps;
- the opportunity of calculating the trip’s route and estimated cost, having entered the destination;
- the possibility of ordering a taxi without gps tracking, using the address search engine;
- showing points of interest around the location;
- details about the driver and the taxi vehicle;
- the possibility to communicate by phone with the driver or with the taxi dispatcher;
- client-driver messages;
Cris Taxi Bucharest is proud of a bright and long tradition in the field of passenger transport (taxi) since 1992.
Our taxi services fully cover both Bucharest and the surrounding areas.
Cris Taxi Bucharest has a fleet of 1000 cars (Skoda Octavia, Renault Clio, Dacia Logan).
Among the services offered by CrisTaxi Bucharest you will find a modern taxi dispatcher, based on online and telephone orders

